      <div>
        <h5>{post.titulo}</h5>
        <div>{post.corpo}</div>
        <div>{post.autor}</div>
        <div>{post.categoria}</div>
        <button onClick={() => this.handleClick(post.id)}>Excluir</button>
        <hr></hr>
      </div>
    );
  }

